import React from "react";
import HobbyCard from "../components/HobbyCard";
import { useNavigate } from "react-router-dom";

const sampleHobbies = [
  { id: "painting", name: "그림 그리기", short: "아크릴/수채화" },
  { id: "hiking", name: "등산", short: "주말 산행" },
  { id: "cafe", name: "카페 탐방", short: "맛집 카페" },
  { id: "guitar", name: "기타", short: "악기 연주" }
];

export default function MainPage() {
  const navigate = useNavigate();

  return (
    <div className="page main-page">
      <h1>메인 페이지</h1>

      <section className="panel">
        <h3>추천 취미</h3>
        <div className="grid">
          {sampleHobbies.map(h => <HobbyCard key={h.id} hobby={h} />)}
        </div>
      </section>

      <section className="panel">
        <h3>카테고리</h3>
        <div className="category-shortcuts">
          <button onClick={() => navigate("/category")}>카테고리 보기</button>
          <button onClick={() => navigate("/create-group")}>모임 개설</button>
        </div>
      </section>
    </div>
  );
}
